import React from "react";
import { Formik } from "formik"
import { View, TextInput } from "react-native";

const initialValues = {
    email: "", 
    password: "", 
}

export default function(){
    return(
        <Formik 
            initialValues={initialValues}
            onSubmit={values => console.log(values)}
        >
            {({handleChange, handleSubmit, v}) =>{
                return (
                <View>
                    <TextInput />
                    <TextInput />
                </View>
                )
            }}
        </Formik>
    )
}
